import React, { Component } from 'react';
import { BrowserRouter as Router, Route, NavLink, Link, Switch } from 'react-router-dom';
import { Redirect } from 'react-router-dom';

import '../Home/HomeCSS/Body2.css';
import '../Home/Body2Images'
import Background1 from '../Body2Images/littlegirl.png';
import Background2 from '../Body2Images/puzzles.png';
import Background3 from '../Body2Images/teamwork.png';
import Background4 from '../Body2Images/girlstudying.png';
import Atom from '../Body2Images/atom copy.png';
import Brain from '../Body2Images/brain copy.png';
import Idea from '../Body2Images/idea copy.png';
import Team from '../Body2Images/team copy.png';

function Body2() {
        return (
            <div>
                 <div className="teach">
            <h3 className="teachTitle">Teaching kids programming and digital skills is <em>MORE</em> than just writing code.</h3>

            <div className="flexContainer">
                <div className="imgBox"> 
                    <p className="imgText"><img className="textLogo" src={Idea} alt="logo"/><br/>Creativity <br/>& Individuality</p> 
                    <img className="learnbox" src={Background1} alt="logo"/>
                </div>
            
                <div className="imgBox">
                    <p className="imgText"><img className="textLogo" src={Brain} alt="logo"/><br/>Critical Thinking & Problem Solving</p>
                    <img className="learnbox" src={Background2} alt="logo"/>
                </div>

                <div className="imgBox">
                    <p className="imgText"><img className="textLogo" src={Team} alt="logo"/><br/>Communication & Collaboration</p>
                    <img className="learnbox" src={Background3} alt="logo"/>
                </div>
                
                <div className="imgBox">  
                    <p className="imgText"><img className="textLogo" src={Atom} alt="logo"/><br/>Technology<br/> & Future Focus</p>
                    <img className="learnbox" src={Background4} alt="logo"/>
                </div>
            </div>
            
            <h2 className="title">How our programme helps teachers and schools</h2>
            </div>
            </div>
        )
    }

export default Body2;
